const GLOWTWO_IN_CART = "GLOWTWO_IN_CART";

const ACTION_GLOWTWO_IN_CART = () => {
  return {
    type: GLOWTWO_IN_CART,
    payload: {
      name: "GlowTwo",
      price: 105,
      duration: 50,
    },
  };
};

export default ACTION_GLOWTWO_IN_CART;
